import React from 'react'
import axios from 'axios'

import FormLogin from './LogoutForm'

class UserLogin extends React.Component{
    constructor(){
        super()
        this.state = {
            user:{}
        }
    }
    handleLogin=(data) => {
        console.log(data)
    }
    render(){
        return(
            <div>
                <FormLogin handleLogin={this.handleLogin}/>
            </div>
        )
    }
}
